local Window = Library.CreateLib("TITLE", "Synapse")
local Tab = Window:NewTab("Auto Farm")
local Section = Tab:NewSection("Auto Farm Select")
Section:NewButton("Auto Farm Switch hub Premium", "Auto Farm Switch hub Premium", function()
    if not game:IsLoaded() then 
        repeat game.Loaded:Wait()
        until game:IsLoaded() 
    end
    repeat wait(1)
        pcall(function()
            if game:GetService("Players").LocalPlayer.PlayerGui.Main:FindFirstChild("ChooseTeam") then
                if game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Visible == true then
                    if _G.Team == "Marines" then
                        for i,v in pairs(getconnections(game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Container.Marines.Frame.ViewportFrame.TextButton.MouseButton1Click)) do
                            v.Function()
                        end
                    else
                        for i,v in pairs(getconnections(game:GetService("Players").LocalPlayer.PlayerGui.Main.ChooseTeam.Container.Pirates.Frame.ViewportFrame.TextButton.MouseButton1Click)) do
                            v.Function()
                        end
                    end
                end
            end
        end)
    until game.Players.localPlayer.Neutral == false
    if _G.Fast_Delay == nil then
        _G.Fast_Delay = 0.3
    end
    spawn(function()
        while true do wait()
            getgenv().rejoin = game:GetService("CoreGui").RobloxPromptGui.promptOverlay.ChildAdded:Connect(function(Kick)
                if not _G.TP_Ser and _G.Rejoin then
                    if Kick.Name == 'ErrorPrompt' and Kick:FindFirstChild('MessageArea') and Kick.MessageArea:FindFirstChild("ErrorFrame") then
                        game:GetService("TeleportService"):Teleport(game.PlaceId)
                        wait(50)
                    end
                end
            end)
        end
    end)
    
    local VirtualUser=game:service'VirtualUser'
    game:service'Players'.LocalPlayer.Idled:connect(function()
        VirtualUser:CaptureController()
        VirtualUser:ClickButton2(Vector2.new())
    end)
    
    spawn(function()
        while wait(3) do
            game:GetService'VirtualUser':CaptureController()
        end
    end)
    
    Old_World = false
    New_World = false
    Three_World = false
    local placeId = game.PlaceId
    if placeId == 2753915549 then
        Old_World = true
    elseif placeId == 4442272183 then
        New_World = true
    elseif placeId == 7449423635 then
        Three_World = true
    end
    _G.Color = Color3.fromRGB(68, 202, 186)
    
    _G.Setting_table = {
