                if v then
                    alls = v.Size.Y.Offset + alls
                end
                if not v then
                    alls = 0
                end
            end
            local tl = Instance.new('TextLabel')
            lastMessage = Name..Text
            lastLabel = tl
            tl.Name = Name
            tl.Parent = scroll_2
            tl.ZIndex = 10
            tl.Text = Time().." - ["..Name.."]: "..Text
            tl.Size = UDim2.new(0,322,0,84)
            tl.BackgroundTransparency = 1
