                customAlias[alias] = v
                aliases[#aliases + 1] = {CMD = cmd, ALIAS = alias}
                notify('Aliases Modified',"Added "..alias.." as an alias to "..cmd)
                updatesaves()
                refreshaliases()
                break
            end
        end
    end)
    
